import './App.css';
import ExpenseItem from './components/ExpenseItem';

function App() {
  const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14)
    },
    {
      id:'e2',
      title: 'C',
      amount: 294.67,
      date: new Date(2021, 2, 28)
    },
    {
      title: 'Car Insurence',
      amount: 294.67,
      date: new Date(2021, 2, 28)
    },
    {
      title: 'Car Insurence',
      amount: 294.67,
      date: new Date(2021, 2, 28)
    },
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
